import React from "react";

import '../Css/Boton-Nav.css';

function BotonCambioPag(props){
  return(
    <div className = 'contenedor'>
      <label
        className='imagenBarra'>
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo2}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo3}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo4}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo5}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo6}
      </label>
    </div>
  );
};

export default BotonCambioPag;
